INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (62, "カリン", 1000001, -416.5, 2, "2025/01/31 12:00:00", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 3.414, 1, 190805, 1, 0.0, 1, "2030/01/01 14:59:59");
