INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (63, "カリン", 1000004, -416.5, 2, "2025/01/31 12:00:00", "報酬がもらえますよ！\nチェックしてみてください", 0.0, 4, 190805, 1, 0.0, 2, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (64, "カリン", 1000005, -363.0, 1, "2025/01/31 12:00:00", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 2.12, 5, 190805, 1, 0.0, 2, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (64, "カリン", 1000006, -363.0, 2, "2025/01/31 12:00:00", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1.68, 6, 190805, 1, 0.0, 1, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (64, "カリン", 1000007, -363.0, 1, "2025/01/31 12:00:00", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 2.33, 7, 190805, 1, 0.0, 2, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "ラビリスタ", 1020101, -285.0, 7, "2025/01/31 12:00:00", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 5.18, 101, 133701, 10201, -6.0, 3, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "クリスティーナ", 1020102, -285.0, 2, "2025/01/31 12:00:00", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 8.77, 201, 133901, 10201, -2.0, 1, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "ネネカ", 1020103, -285.0, 1, "2025/01/31 12:00:00", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 15.5, 301, 133801, 10201, 0.0, 6, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "ランファ", 1020201, -285.0, 5, "2025/02/28 12:00:00", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 9.061, 101, 134301, 10202, 0.0, 2, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "チカ", 1020202, -285.0, 2, "2025/02/28 12:00:00", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 7.699, 201, 134401, 10202, 0.0, 1, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "アオイ", 1020301, -285.0, 2, "2025/03/31 12:00:00", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 8.595, 101, 134601, 10203, 0.0, 1, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "クローチェ", 1020302, -285.0, 2, "2025/03/31 12:00:00", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 7.758, 201, 134501, 10203, 0.0, 1, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "ルイズマリー", 1020401, -285.0, 6, "2025/04/30 12:00:00", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 7.0, 101, 132302, 10204, 0.0, 2, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "イロハ", 1020402, -285.0, 2, "2025/04/30 12:00:00", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 7.904, 201, 132402, 10204, 0.0, 1, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "ソノ", 1020403, -285.0, 2, "2025/04/30 12:00:00", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 8.487, 301, 132502, 10204, 0.0, 4, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "カノン", 1020502, -285.0, 2, "2025/05/31 12:00:00", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 8.763, 101, 134901, 10205, 0.0, 1, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "ツムギ", 1020503, -285.0, 3, "2025/05/31 12:00:00", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 6.417, 201, 134801, 10205, 0.0, 1, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "エリス", 1020601, -285.0, 7, "2025/06/30 12:00:00", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 10.335, 101, 135001, 10206, 0.0, 3, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "シェフィ", 1020602, -285.0, 4, "2025/06/30 12:00:00", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 6.281, 201, 135101, 10206, 0.0, 2, "2030/01/01 14:59:59");
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (61, "プレシア", 1020603, -285.0, 2, "2025/06/30 12:00:00", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 12.244, 301, 135201, 10206, 0.0, 1, "2030/01/01 14:59:59");
